Smile
 
They like to say it takes more muscles to frown than smile, but so it also takes more muscles to eat a Twinkie than to not, so what the adage is really saying is unclear. All that gives me joy takes effort. Like hiking and swimming and loving and dancing and crying and drinking and digging my fingernails into my cuticles until they bleed and hiding the pain beneath bandages and lies to my family on Thanksgiving that I am totally okay. I promise to god. I swear on my smile.
// photos by my BOY @jacktdphoto
